import React from "react";
import acm from "./images/acm.jfif";
import Clubs from "./Clubs";
function Card(props) {
  return (
        <div class="col-lg-4">
          <div class="card">
            <img class="card-img-top" src={props.imgsrc} alt="acm"></img>
            <div class="card-body">
              <h5 class="card-title">{props.title}</h5>
              <p class="card-text">
                With supporting text below as a natural lead-in to additional
                content.
              </p>
              <a href="#" class="btn btn-primary">
                Go somewhere
              </a>
            </div>
          </div>
        </div>
  );
}
export default Card;
